(2, 'Belajar Dasar-Dasar DevOps', 1, 1, '<p>DevOps Engineer  adalah sebuah profesi dalam dunia IT (terutama dalam bidang pengembangan aplikasi) yang memiliki pemahaman mendalam tentang siklus hidup pengembangan perangkat lunak (software development life cycle).</p><p><br></p><p>Bila sudah memutuskan berkarier menjadi seorang DevOps Engineer, kamu juga harus tahu bahwa pekerjaanmu mengharuskan berkolaborasi dengan berbagai tim, seperti Developer, System Administrator atau IT Operations, Information Security, dan staf IT lainnya yang memiliki pengetahuan mendalam tentang berbagai tools dalam mengembangkan pipeline untuk mengelola deployment dan proses pengembangan aplikasi.</p>', 0, 0, 'devops11.jpg', 1),
(5, 'Belajar Docker', 1, 9, '<p>Learn Docker in this interactive, hands-on Docker tutorial online course! You’ll be able to follow the Docker learning path, the workloads for which it is best suited, and how to migrate existing applications into containers. This Docker overview covers core container concepts and how to deploy and orchestrate containers. A focus of the course is the container role in modern DevOps, including using Docker with configuration management and continuous integration tools. In addition, emphasis is placed on best practices for Docker files and container deployment for high availability, robust and secure software.</p><p>This hands-on course is designed for anyone wanting to learn how to manage and deploy applications using containers and the Docker platform.</p>', 0, 0, 'devops3.jpeg', 1);

