INSERT INTO `submodule_course` (`submodule_course_id`, `module_course_id`, `submodule_name`, `submodule_content`) VALUES
(4, 2, 'Pengertian DevOps', '<p>Teknisi DevOps adalah pengembang atau administrator infrastruktur yang juga memiliki keahlian penting dalam bekerja dengan orang, proses, dan produk untuk memungkinkan pengiriman nilai berkelanjutan dalam organisasi. Teknisi DevOps membantu merancang dan menerapkan strategi untuk kolaborasi, kode, infrastruktur, kontrol sumber, keamanan, kepatuhan, integrasi berkelanjutan, pengujian, pengiriman, pemantauan, dan umpan balik.</p><p><br></p><p><img src=\"https://devblogs.microsoft.com/premier-developer/wp-content/uploads/sites/31/2020/03/word-image.jpeg\" alt=\"DevOps for low code Business Applications - Developer Support\"></p>'),
(5, 2, 'DevOps Dimata Industri', '<p>Meski memiliki tanggung jawab cukup banyak, kamu tidak harus menunggu hingga punya karier di level manajemen tingkat atas untuk bekerja di posisi DevOps.</p><p>Dikarenakan profesi ini terbilang baru, menurut <a href=\"https://hired.com/job-roles/devops-engineer#skills_section\" rel=\"noopener noreferrer\" target=\"_blank\">Hired</a>, ada beragam kesempatan yang bisa muncul saat menempuh karier di bidang DevOps.</p><p>Terlepas dari itu, Hired menggambarkan jenjang yang dapat ditempuh adalah dengan memulai sebagai <em>junior DevOps Engineer</em>. Lalu, karier ini akan berlanjut menjadi <em>senior DevOps Engineer</em>.</p><p><br></p><p><img src=\"https://glints.com/id/lowongan/wp-content/uploads/2019/05/adult-coder-coding-1181676.jpg\" alt=\"lowongan kerja it\" height=\"400\" width=\"600\"></p><p><br></p><p>Menurut <a href=\"https://intellipaat.com/blog/devops-engineer-career-path/\" rel=\"noopener noreferrer\" target=\"_blank\">Intellipaat</a>, ada beragam peran dan tanggung jawab yang bisa ditempuh jika mengikuti karier DevOps Engineer. Peran-peran tersebut adalah:</p><ul><li><em>DevOps Architect</em></li><li><em>Automation Engineer</em></li><li><em>Software Tester</em></li><li><em>Security Engineer</em></li><li><em>Integration Specialist</em></li><li><em>Release Manager</em></li></ul><p><br></p><p>Tentu, pola semacam itu bisa berbeda tergantung pada kebijakan masing-masing perusahaan. Terlepas dari itu, karier sebagai <em>DevOps Engineer</em> di era saat ini tergolong menjanjikan.</p><p>Menurut <a href=\"https://www.edureka.co/blog/devops-engineer-career-path-your-guide-to-bagging-top-devops-jobs\" rel=\"noopener noreferrer\" target=\"_blank\">Edureka</a>, DevOps Engineer adalah salah satu pekerjaan di dunia IT dengan bayaran tertinggi. Tak hanya itu, kebutuhan pasar akan profesi ini juga mengalami pertumbuhan yang pesat.</p>'),
(6, 2, 'Pengertian Monolithic dan Microservices', '<p><img src=\"https://www.webarq.com:8002/cfind/convert/webp/thumb/images/blog/artikel-update/juli-2021---april-2021/cover_w520_h383_title-cover-11.jpg.webp\" alt=\"Microservices vs Monolitik, Mana yang Lebih Baik untuk Arsitektur Teknologi Bisnis Masa Kini?\"></p><p><br></p><p>Sistem arsitektur Microservices sendiri baru hadir beberapa tahun lalu, dan kemudian berakselerasi menjadi tren belakangan ini. Microservices banyak diadopsi oleh perusahaan teknologi raksasa di Indonesia, seperti Tokopedia, Gojek, dan Traveloka. Microservices dipilih karena sifatnya yang lentur atau fleksibel dalam menyesuaikan sistem aplikasi dengan pasar yang sangat dinamis. Keuntungan yang ada di depan mata dalam menggunakan sistem microservices merupakan daya tarik tersendiri bagi para perusahaan teknologi, mulai dari kesempatan perluasan bisnis, kelenturan dan kecepatan penyesuaian dalam bisnis, dan keuntungan-keuntungan lainnya. </p><p><br></p><p>Selanjutnya, kita akan melakukan perbandingan antara sistem arsitektur monolitik dan microservices untuk menentukan arsitektur aplikasi mana yang cocok untuk bisnis Anda saat ini. </p><p><br></p><h3><strong class=\"ql-size-large\">Monolitik</strong></h3><p>Monolitik merupakan sebuah pendekatan tradisional dalam pembangunan sebuah aplikasi. Aplikasi monolitik terbentuk sebagai satu kesatuan kode yang tidak dapat dipisahkan satu dan lainnya. Salah satu karakter sistem arsitektur monolitik adalah saat pemrogram ingin melakukan perubahan pada sistem monolitik, pemrogram harus mengubah satu kesatuan kode secara menyeluruh dan bersamaan.</p><p><br></p><p><strong>Kelebihan Arsitektur Monolitik</strong></p><p><strong>1.   Kemudahan dalam penerapan.</strong></p><p>Sistem monolitik terbilang sistem yang sederhana sehingga dalam penerapannya pun tidak perlu banyak menangani file atau direktori.</p><p><strong>2.   Sederhana untuk dikembangkan.</strong></p><p>Monolitik adalah pendekatan standar dalam pembangunan sebuah aplikasi, sehingga banyak orang bisa melakukan pengembangannya.</p><p><strong>3.   Debugging dan testing yang lebih mudah.</strong></p><p>Sistem monolitik tidak terbagi menjadi bagian-bagian kecil, sehingga lebih cepat dalam melakukan debungging dan testing. </p><p> </p><p><strong>Kekurangan Arsitektur Monolitik</strong></p><p><strong>1.   Sulit memahami kode pemrograman saat pemeliharaan.</strong></p><p>Sistem monolitik untuk pengembangan aplikasi berskala besar dan rumit akan membuat kode pemrogramannya semakin kompleks. Hal ini akan menimbulkan kesulitan pemahaman tersendiri, terlebih bagi pemrogram yang dari awal tidak ikut mengembangkan aplikasinya. </p><p><strong>2.   Sulit melakukan perubahan.</strong></p><p>Semakin besar aplikasi yang sudah ada, semakin rumit juga perubahan yang perlu dilakukan. Hal ini tentunya akan membuat proses pekerjaan semakin lama dan berbelit-belit, karena satu perubahan akan sangat mempengaruhi keseluruhan sistem yang ada.</p><p><strong>3.   Sulit mengembangkan aplikasi.</strong></p><p>Dengan menggunakan sistem monolitik, pemrogram tidak bisa leluasa melakukan pengembangan program pada kemudian hari. Hal ini karena perubahan sistem harus dilakukan secara menyeluruh, tidak bisa hanya sebagian kecil.</p><p><strong>4.   Sulit mengadopsi teknologi baru.</strong></p><p>Untuk bisa menggunakan teknologi baru, kode aplikasi dengan sistem monolitik harus ditulis ulang secara keseluruhan.</p><p> </p><h3><strong class=\"ql-size-large\">Microservices</strong></h3><p>Jika monolitik adalah sebuah arsitektur aplikasi secara kesatuan atau tunggal, maka microservices adalah sebaliknya. Microservices terbagi menjadi unit pecahan yang lebih kecil dan spesifik. Setiap unitnya terpisah dan memiliki sistem beserta database sendiri untuk beroperasi dan menggunakan mekanisme API untuk terhubung dengan unit lainnya.</p><p><br></p><p><strong>Kelebihan Microservices</strong></p><p><strong>1. Unit yang mandiri.</strong></p><p>Setiap unit bisa beroperasi secara terpisah, sehingga bersifat lebih fleksibel. Saat terjadi bug, hanya unit yang terdampak yang harus diperbaiki dan tidak mempengaruhi unit yang lain.</p><p><strong>2. Lebih mudah dipahami.</strong></p><p>Alur kerja microservices lebih mudah dipahami karena terpecah menjadi unit yang lebih kecil, dibanding harus mempelajari alur kerja monolitik yang harus dipahami secara keseluruhan.</p><p><strong>3. Mudah mengembangkan aplikasi</strong>.</p><p>Karena sifat setiap unitnya bisa beroperasi secara mandiri, microservices lebih mudah dikembangkan pada kemudian hari.</p><p><strong>4. Bebas adopsi teknologi baru.</strong></p><p>Setiap unit pada arsitektur microservices bisa lebih fleksibel dikembangkan sehingga akan lebih maksimal saat mengadopsi teknologi baru sesuai kebutuhan.</p><p><br></p><p> <strong>Kekurangan Microservices</strong></p><p><strong>1. Tingkat kerumitan yang berbeda.</strong></p><p>Sistem yang terpecah menjadi unit-unit kecil memerlukan sistem distribusi yang baik untuk menghubungkan antar unit dengan database.</p><p><strong>2. Testing yang rumit.</strong></p><p>Pengujian sistem akan menjadi lebih sulit karena banyak komponen yang harus diuji dan diperbaiki.</p><p><br></p><p>Jadi pendekatan mana yang cocok untuk bisnis Anda?</p><p><strong>Monolitik :</strong></p><ul><li>Anda memiliki tim yang kecil</li><li>Sistem aplikasinya sederhana</li><li>Tim Anda belum memiliki pengalaman dan keahlian mengembangkan sistem microservices</li><li>utuh meluncurkan aplikasi lebih cepat</li></ul><p><br></p><p><strong>Microservices :</strong></p><ul><li>Memiliki pengalaman dan keahlian mengembangkan sistem microservices</li><li>plikasi lebih rumit dan bertujuan untuk perluasan bisnis</li><li>Memiliki tim programmer yang memadai</li></ul><p><br></p>'),
(12, 5, 'Apa Itu Docker?', '<p>Docker adalah <em>platform </em>perangkat lunak <em>open source</em> yang digunakan pengembang untuk mengemas, mendistribusikan, dan menjalankan aplikasi bersama dengan semua dependensinya dalam lingkungan yang terisolasi menggunakan <em>container</em>.</p><p>Hal ini membantu <em>developer </em>dalam proses pengembangan, penyebaran, dan manajemen aplikasi yakni dengan cara mengisolasi aplikasi dan dependensinya dari infrastruktur di mana mereka berjalan.</p><p>Tidak hanya itu, Docker juga menyediakan solusi yang efisien untuk mengelola aplikasi dan layanan, yaitu memungkinkan pengguna untuk membuat dan menjalankan <em>container </em>di lingkungan <em>cloud</em> yang fleksibel dan skalabilitas.</p><p>Dalam penggunaannya, pengembang menggunakan Docker Client untuk berinteraksi dengan Docker Daemon. Alat ini menyediakan <em>command line </em>dan API yang memungkinkan pengguna untuk memerintahkan Docker Daemon untuk melakukan tugas-tugas seperti membuat, menjalankan, menghentikan, atau menghapus <em>container</em>.</p><p>Selain menggunakan Docker dalam isolasi aplikasi, ada pula beberapa alternatif yang serupa seperti <a href=\"https://www.dewaweb.com/blog/kubernetes-adalah/\" rel=\"noopener noreferrer\" target=\"_blank\">Kubernetes</a>, containerd, dan Podman. Pengguna dapat memilih mana yang paling sesuai dengan preferensinya.</p>'),
(13, 5, 'Bagaimana Docker Bekerja?', '<p>Docker adalah sebuah <em>platform </em>yang bekerja sebagai sistem operasi bagi <em>container</em>. Docker diinstal pada setiap server dan menyediakan perintah-perintah sederhana yang dapat digunakan untuk membuat, memulai, dan menghentikan <em>container</em>.</p><p>Docker menggunakan arsitektur client-server, di mana client berinteraksi dengan Docker daemon yang bertugas menjalankan, mendistribusikan, dan membuat <em>container</em>. Baik Docker <em>client </em>maupun daemon dapat berjalan pada sistem operasi yang sama.</p><p><br></p><p>Interaksi antara Docker daemon dan client dilakukan melalui Docker Engine RestAPI. Docker daemon menerima permintaan dari client melalui API yang diakses melalui protokol HTTP.</p><p>Kemampuan <em>container </em>dimungkinkan oleh isolasi proses dan kemampuan virtualisasi yang terintegrasi dalam kernel Linux. Kemampuan-kemampuan ini, seperti pengelompokan kontrol (Cgroups) untuk mengalokasikan sumber daya di antara proses, dan <em>namespace </em>untuk membatasi akses atau visibilitas proses terhadap sumber daya dalam sistem.</p><p>Pada akhirnya, teknologi <em>container </em>menawarkan semua fungsi dan manfaat yang dimiliki oleh VM, termasuk isolasi aplikasi dan skalabilitas yang hemat biaya.</p>'),
(14, 5, 'Istilah-Istilah dalam Docker', '<p>Setelah mengerti pengertian dan cara kerja Docker, selanjutnya kamu juga harus mengetahui istilah-istilah yang akan kamu temui ketika menggunakan Docker.</p><ul><li><strong>Docker image – </strong>kumpulan file yang berisi informasi untuk membangun sebuah <em>container </em>.</li><li><strong>Docker container – </strong>environment untuk mengemas aplikasi yang mencakup <em>system tools, library, code, runtime</em> dan konfigurasi.</li><li><strong>Docker client –</strong> tempat user mengirimkan command seperti Docker <em>run, build, dan pull </em>pada Docker daemon.</li><li><strong>Docker Engine RestAPI – </strong>komponen yang bisa diakses client melalui HTTP untuk berinteraksi dengan Docker daemon.</li><li><strong>Docker daemon – </strong>tempat pengelolaan Docker image, container, network, dan volume. Docker Daemon menyediakan antarmuka command line (CLI) pada sisi client sehingga pengguna dapat berinteraksi dengan proses Docker Daemon melalui Docker API. Bertugas menerima request dari Docker <a href=\"https://www.dewaweb.com/blog/apa-itu-api/\" rel=\"noopener noreferrer\" target=\"_blank\">API</a> yang akan diproses selanjutnya oleh sistem.</li><li><strong>Docker host –</strong> komponen yang bertugas menerima perintah dari Docker client dan menyediakan <em>environment </em>untuk menjalankan aplikasi.</li><li><strong>Docker registry – </strong>tempat untuk menyimpan Docker image yang kemudian akan memberikan output sesuai dengan perintah yang diberikan.</li><li><strong>Docker hub – </strong>layanan yang dapat digunakan untuk berbagi <em>container image.</em></li><li><strong>Docker desktop – </strong>aplikasi untuk Mac atau Windows yang mencakup Docker Engine, Docker CLI client, Docker Compose, <a href=\"https://www.dewaweb.com/blog/kubernetes-adalah/\" rel=\"noopener noreferrer\" target=\"_blank\">Kubernetes</a>, serta mencakup akses ke Docker Hub. </li><li><strong>Docker file –</strong> file teks yang berfungsi sebagai instruksi untuk membangun sebuah image Docker. Pengguna mendefinisikan langkah-langkah yang diperlukan untuk membuat image Docker yang berisi semua dependensi dan konfigurasi yang dibutuhkan untuk menjalankan sebuah aplikasi. </li></ul><p><br></p>'),
(15, 5, 'Kelebihan Docker', '<p>Sebelum Docker telah ada teknologi <em>container </em>pertama kali yaitu LinuXContainer (LXC) yang memungkinkan virtualisasi untuk satu instance Linux. Dibandingkan dengan LXC, Docker menawarkan beberapa kelebihan sebagai berikut.</p><ul><li><strong>Portabilitas <em>container </em>yang lancar dan otomatis: </strong><em>container </em>Docker dapat berjalan tanpa modifikasi di berbagai lingkungan. Docker juga dapat membuat <em>container </em>secara otomatis dari kode sumber.</li><li><strong>Bobot yang lebih ringan dan pembaruan terperinci: </strong>beberapa proses dapat digabungkan dalam satu <em>container </em>Docker.</li><li><strong>Penggunaan kembali <em>container</em>: </strong><em>container </em>yang ada dapat digunakan sebagai dasar untuk membuat <em>container </em>baru.</li><li><strong>Kemudahan penggunaan: </strong>Docker menyediakan perintah dan API yang sederhana sehingga siapa pun bisa dengan mudah dan cepat membuat, menjalankan, dan mengelola <em>container </em>Docker. Tidak diperlukan pengetahuan mendalam tentang teknologi virtualisasi.</li><li><strong>Kecepatan</strong>: <em>container </em>Docker sangat ringan dan berjalan di atas host kernel sehingga dapat dibuat dan dijalankan dalam hitungan detik saja. Ini jauh lebih cepat dibandingkan teknologi virtualisasi tradisional seperti VM yang perlu proses boot sistem operasi lengkap.</li><li><strong>Docker Hub: </strong>Docker Hub menyediakan ribuan image/<em>container </em> siap pakai yang dibuat oleh komunitas Docker. Developer bisa langsung menggunakan <em>image </em>ini sebagai dasar <em>container </em>tanpa harus membuat dari awal.</li><li><strong>Skalabilitas: </strong>Docker membuat pengembang sangat mudah untuk memisahkan fungsi-fungsi aplikasi ke dalam <em>container </em>terpisah. Misal <a href=\"https://www.dewaweb.com/blog/apa-itu-database/\" rel=\"noopener noreferrer\" target=\"_blank\"><em>database</em></a> di <em>container </em>1, <em>cache </em>di <em>container </em>2, <em>app </em>di <em>container </em>3. Hal ini memudahkan untuk melakukan <em>scaling </em>atau update secara independen.</li></ul><p><br></p>');
INSERT INTO `submodule_course` (`submodule_course_id`, `module_course_id`, `submodule_name`, `submodule_content`) VALUES
(16, 6, 'Docker Architecture', '<p><img src=\"data:image/png;base64,\"></p><p><br></p><p>Docker menggunakan arsitektur client-server. Docker client berbicara kepada Docker daemon yang bekerja dalam membentuk aplikasi, menjalankan aplikasi dan mendistribusikan aplikasi. Docker client Docker daemon dapat menggunakan sistem yang sama, atau juga Docker client berkomunikasi dengan Docker daemon secara remote. Docker client dan Docker daemon dapat berkomunikasi menggunakan REST API, menggunakan soket UNIX atau network interface. Docker client yang lain adalah Docker Compose yang memungkinkan kita bekerja dengan beberapa aplikasi dari suatu set yang terdiri dari beberaoa container.</p><p>Beberapa komponen yang akan kita bicarakan secara singkat adalah:</p><ul><li><strong>Docker daemon</strong></li></ul><p>Docker daemon dengan nama <em>dockerd</em> ini mendengarkan permintaan Docker API dan melakukan pengaturan obyek docker seperti images, containers, network dan volume. Docker daemon ini juga dapat berkomunikasi dengan daemon yang lain dalam rangka memberikan layanan Docker.</p><ul><li><strong>Docker client</strong></li></ul><p>Docker client dengan nama <em>docker</em> inilah yang berkomunikasi dengan Docker daemon <em>dockerd</em> menggunakan Docker API. Docker client dapat berkomunikasi dengan lebih dari satu Docker daemon.</p><ul><li><strong>Docker desktop</strong></li></ul><p>Docker Desktop merupakan aplikasi yang dengan mudah diinstal pada Mac atau Windows yang memungkinkan kita membangun aplikasi berbasis container dan juga microservices. Docker Desktop meliputi Docker daemon atau dockerd, Docker client atau docker, Docker Compose, Docker Content Trust, Kubernetes, dan Credential Helper. Informasi lebih lanjut mengenai Docker Desktop silahkan mengunjungi <a href=\"https://docs.docker.com/desktop/\" rel=\"noopener noreferrer\" target=\"_blank\">https://docs.docker.com/desktop/</a></p><ul><li><strong>Docker registry</strong></li></ul><p>Docker registry ini akan gudang dalam menampung image-image. Docker Hub merupakan public Docker registry yang dapat digunakan oleh siapa saja.</p><p>Ketika kita menggunakan perintah docker pull atau docker run maka image yang diperlukan akan ditarik dari docker registry. Ketika kita menggunakan perintah docker push maka image kita akan didorong ke Docker registry.</p><ul><li><strong>Docker object</strong></li></ul><p>Ketika kita menggunakan Docker maka kita membuat atau menggunakan obyek dari docker antara lain images, container, network, volume, plugin dan obyek-obyek yang lain.</p><p><br></p>');
